import numpy as np

from ch9.code.ch9_06 import suffix_array
from ch9.code.ch9_07 import burrows_wheeler_transform_construction
from ch9.code.ch9_17 import partial_suffix_array


def data_checkpoints(bw_text, C):
    last_col = list(bw_text)
    first_col = sorted(last_col)
    count = {k: np.zeros(len(bw_text) + 1, dtype=int) for k in sorted(set(bw_text))}
    first_occurrence = {k: 0 for k in count}

    for i, s in enumerate(bw_text):
        count[s][i + 1:] += 1

    checkpoints = {k: v[::C] for k, v in count.items()}
    for i, pair in enumerate(first_col):
        if first_occurrence[pair] == 0:
            first_occurrence[pair] = i

    return first_occurrence, last_col, checkpoints


def count_symbol_checkpoints(symbol, i, last_col, checkpoints, C):
    if not checkpoints:
        checkpoints = data_checkpoints(last_col, C)[2]
    index = i // C

    c = checkpoints[symbol][index]
    j = index * C
    # print(i, c, j, index)
    while j < i:
        if last_col[j] == symbol:
            c += 1
        j += 1
    return c


def burrows_wheeler_matching_positions(last_column, first_occurrence, checkpoints, C, partial, pattern):
    top = 0
    bottom = len(last_column) - 1
    while top <= bottom:
        # print(top, bottom)
        if pattern:
            symbol = pattern[-1]
            pattern = pattern[:-1]
            count_t = count_symbol_checkpoints(symbol, top, last_column, checkpoints, C)
            count_b = count_symbol_checkpoints(symbol, bottom + 1, last_column, checkpoints, C)
            if count_b > count_t:
                top = first_occurrence[symbol] + count_t
                bottom = first_occurrence[symbol] + count_b - 1
            else:
                return []
        else:
            # print(bottom - top + 1,  top, bottom)
            return [partial[i] for i in range(top, bottom + 1)]
    return []


def solve_burrows_wheeler_matching_checkpoints(string, patterns, C=5):
    bw_text = burrows_wheeler_transform_construction(string)
    partial = suffix_array(string)
    first_occurrence, last_column, checkpoints = data_checkpoints(bw_text, C)
    # print(partial)
    # print(bw_text)
    # print(first_occurrence)
    # print(last_column)
    count = []
    for pattern in patterns.split():
        count.extend(burrows_wheeler_matching_positions(last_column, first_occurrence, checkpoints, C, partial, pattern))
    return count


